class ListNode:
    def __init__(self, x):
        self.val = x
        self.next = None


def generateMatrix(n: int) -> [[int]]:
    matrix = [[0 for i in range(n)] for x in range(n)]
    i = 0
    j = 0
    lv = 1
    for count in range(1, n*n + 1):
        matrix[i][j] = count
        if lv == 1:
            j += 1
        elif lv == 2:
            i += 1
        elif lv == 3:
            j -= 1
        elif lv == 4:
            i -= 1

        if lv == 1 and (j == n or matrix[i][j] != 0):
            lv = 2
            j -= 1
            i += 1
        elif lv == 2 and (i == n or matrix[i][j] != 0):
            lv =3
            i -= 1
            j -= 1
        elif lv ==3 and (j == -1 or matrix[i][j] != 0):
            lv = 4
            j += 1
            i -= 1
        elif lv == 4 and (i == -1 or matrix[i][j] != 0):
            lv = 1
            i += 1
            j += 1
    return matrix

def rotateRight(head: ListNode, k: int) -> ListNode:
    if head == None:
        return head
    lists = []
    while head != None:
        lists.append(head)
        head = head.next
    k = k % len(lists)
    if k == 0:
        return lists[0]
    else:
        k = len(lists) - k
        head = lists[k]
        lists[k - 1].next = None
        lists[len(lists) - 1].next = lists[0]
        return head
def uniquePaths(m: int, n: int) -> int:
    matrix = [[0 for x in range(m)] for y in range(n)]
    for x in range(m):
        matrix[0][x] = 1
    for y in range(n):
        matrix[y][0] = 1
    for i in range(1, n):
        for j in range(1, m):
            matrix[i][j] = matrix[i - 1][j] + matrix[i][j - 1]
    return matrix[n - 1][m - 1]


def climbStairs(n: int) -> int:
    if n <= 1:
        return 1
    res = [0 for x in range(n)]
    res[0] = 1
    res[1] = 2
    for i in range(2, n):
        res[i] = res[i - 1] + res[i - 2]
    return res[n - 1]

def subsets(nums: [int]) -> [[int]]:
    if len(nums) == 0:
        return []
    nums.sort()
    res = [[] for x in range(len(nums) + 1)]
    res_i = []
    for num in nums:
        res_i.append([num])
    res[1] = res_i
    for i in range(2, len(nums) + 1):
        res_i = []
        res_i_1 = res[i - 1]

        for re in res_i_1:
            max_re = re[-1]
            ind = nums.index(max_re)
            for j in range(ind + 1, len(nums)):
                re_n = re[:]
                num = nums[j]
                # if num not in re_n:
                re_n.append(num)
                    # if re_n not in res_i:
                res_i.append(re_n)
        res[i] = res_i
    res_all = []
    for res_i in res:
        for r in res_i:
            res_all.append(r)
    res_all.append([])
    return res_all

def merge(nums1: [int], m: int, nums2:[int], n: int) -> None:
    i1 = 0
    for i2 in range(n):
        num = nums2[i2]
        while i1 < m:
            if nums1[i1] > num:
                nums1.insert(i1, num)
                m += 1
                break
            else:
                i1 += 1
        if i1 >= m:
            nums1.insert(m, num)
            m += 1
            i1 += 1
    for i in range(m, len(nums1)):
        nums1.pop()

def grayCode(n: int) -> [int]:
    if n <= 0:
        return [0]
    res = [[] for  x in range(n)]
    res_1 = [[0],[1]]
    res[0] = res_1
    for i in range(1, n):
        res_i_1 = res[i - 1]
        l = len(res_i_1)
        res_i = [[] for x in range(2*l)]
        res_i_1 = res[i - 1]
        for r in range(l):
            res_i_1_new = res_i_1[r][:]
            res_i_1_new.append(0)
            res_i[r] = res_i_1_new
            res_i_1_new = res_i_1[r][:]
            res_i_1_new.append(1)
            res_i[2*l - 1 - r] = res_i_1_new
        res[i] = res_i
    res_num = []
    for i in res[n - 1]:
        s = 0
        for x in i:
            s = s*2 + x
        res_num.append(s)
    return res_num

# Definition for a binary tree node.
class TreeNode:
    def __init__(self, x):
        self.val = x
        self.left = None
        self.right = None


def maxDepth(root: TreeNode) -> int:
    node_deep = {}
    node_deep[root] = 1
    nodes = []
    while root != None or len(nodes) > 0:
        if root.left == None and root.right == None:
            if len(nodes) > 0:
                root = nodes.pop()
                continue
            else:
                break

        if root.right != None:
            node_deep[root.right] = node_deep[root] + 1
            nodes.append(root.right)
        if root.left != None:
            node_deep[root.left] = node_deep[root] + 1
            root = root.left
        else:
            root = root.right

    value = max(node_deep.values())
    return value

def load(nums)-> TreeNode:
    l = int(len(nums)/2)
    list_node = [None for i in nums]
    head = TreeNode(nums[0])
    for i in range(l):
        if i == 0:
            head = TreeNode(nums[i])
            list_node[i] = head
        node_i = list_node[i]
        left = None
        right = None
        if 2 * i + 1 < len(nums) and nums[2 * i + 1] != None:
            left = TreeNode(nums[2 * i + 1])
        if 2 * i + 2 < len(nums) and nums[2 * i + 2] != None:
            right = TreeNode(nums[2 * i + 2])
        if node_i == None:
            continue
        node_i.left = left
        node_i.right = right
        if 2 * i + 1 < len(nums):
            list_node[2 * i + 1] = left
        if 2 * i + 2 < len(nums):
            list_node[2 * i + 2] = right
    return head

def maxProfit(prices:[int]) -> int:
    buy = prices[0]
    max_sale = 0
    for i in range(1, len(prices)):
        if prices[i] < buy:
            buy = prices[i]
        else:
            sale = prices[i] - buy
            if sale > max_sale:
                max_sale = sale
    return max_sale

def maxPathSum(root: TreeNode) -> int:
    nodes = []
    nodes_right = []
    while root != None:
        nodes.append(root)
        if root.right != None:
            nodes_right.append(root.right)
        if root.left != None:
            root = root.left
        elif root.right != None:
            root = root.right
        else:
            if len(nodes_right) > 0:
                root = nodes_right.pop()
            else:
                break
    path_half = {}
    pathSum = {}
    pathSum[None] = 0
    path_half[None] = 0
    while len(nodes) > 0:
        node = nodes.pop()
        left = node.left
        right = node.right
        path_half[node] = max(path_half[left], path_half[right], 0) + node.val
        pathSum[node] = max(path_half[left] + path_half[right], path_half[right], path_half[left], 0) + node.val
    pathSum.pop(None)
    return max(pathSum.values())






